import React from 'react';
import './ProgramTypes.css';
import { FaEdit, FaTrash } from 'react-icons/fa';

function ProgramTypes() {
  return (
    <div className="program-types">
      {/* <button className="program-types__add-new-button">+ Add New</button> */}
      <div className='pr'>
        <div>Program Types</div>
        <button className="program-types__add-new-button">+ Add New</button>
      </div>
      <table className="program-types__content-table">
        <thead>
          <tr>
            <th>Type of content</th>
            <th>Description</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {[...Array(10)].map((_, index) => (
            <tr key={index}>
              <td>IAP</td>
              <td>Investor awareness programme content document</td>
              <td>
                <button className="program-types__edit-button"><FaEdit />  Edit</button>
                <button className="program-types__delete-button"><FaTrash />  Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ProgramTypes;
